import React from 'react';
import { Link } from 'react-router-dom';

import Col1 from "../../components/col1";
import Col2 from "../../components/col2";
import Col3 from "../../components/col3";
import SetCol1 from "../../components/SetCol1";


//Images
import Bedroom from "../../Images/Bedroom/Apartment.jpg"
import BegginingSandyOutside from "./Images/Apartment_outside/Sandy-A_outside-Anri_Emily.png";
import BegginingAmyOutside from "./Images/Apartment_outside/Amy-A_outside-BP_Gotti.png";

const GoOutside = ( props ) => {

    if(props.flags.includes("FirstMorning"))
        return(
            <>
            <Col1>
                <SetCol1
                money = {props.money}
                energy = {props.energy}
                date = {props.date}
                />
            </Col1>
            <Col2 BackImage = {Bedroom}>
                
            </Col2>
    
            <Col3 > 
                <p>OUTSIDE</p>
                <Link to={"/Home"} style={{ textDecoration: "none" }}>
                    <button type="button" className="btn btn-primary">Go back home</button>
                </Link>
    
            </Col3>
            </>
            )
}

export default GoOutside;
